import React, { Component } from "react";
import PlayerBanner from "./playerBanner";

class Players extends Component {
  render() {
    const {
      onCheck,
      onCall,
      onRaise,
      onFold,
      onRaised,
      players,
      betOutstanding,
    } = this.props;
    return (
      <div>
        {players.map((player) => (
          <PlayerBanner
            key={player.id}
            player={player}
            onCheck={onCheck}
            onCall={onCall}
            onRaise={onRaise}
            onRaised={onRaised}
            onFold={onFold}
            betOutstanding={betOutstanding}
          ></PlayerBanner>
        ))}
      </div>
    );
  }
}

export default Players;
